public class InnerDataSourceS3DataSourceConfigurationFactory(Action<Humidifier.Kendra.DataSourceTypes.S3DataSourceConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Kendra.DataSourceTypes.S3DataSourceConfiguration>
{

    internal InnerDataSourceAccessControlListConfigurationFactory AccessControlListConfigurationFactory { get; set; }

    internal InnerDataSourceDocumentsMetadataConfigurationFactory DocumentsMetadataConfigurationFactory { get; set; }

    protected override Humidifier.Kendra.DataSourceTypes.S3DataSourceConfiguration Create()
    {
        var s3DataSourceConfigurationResult = CreateS3DataSourceConfiguration();
        factoryAction?.Invoke(s3DataSourceConfigurationResult);

        return s3DataSourceConfigurationResult;
    }

    private Humidifier.Kendra.DataSourceTypes.S3DataSourceConfiguration CreateS3DataSourceConfiguration()
    {
        var s3DataSourceConfigurationResult = new Humidifier.Kendra.DataSourceTypes.S3DataSourceConfiguration();

        return s3DataSourceConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Kendra.DataSourceTypes.S3DataSourceConfiguration result)
    {
        base.CreateChildren(result);

        result.AccessControlListConfiguration ??= AccessControlListConfigurationFactory?.Build();
        result.DocumentsMetadataConfiguration ??= DocumentsMetadataConfigurationFactory?.Build();
    }

} // End Of Class

